import React from "react";
import Button from "@material-ui/core/Button";
export default function Pagination(props){
    updatePage=(e)=>{
        console.log(e.target.innerHTML);
        props.updatePage(e.target.innerHTML);
    }
    return(
        <div className="bar">
            <Button onClick={this.updatePage} className="selection"> 1 </Button> 
            <Button onClick={this.updatePage} className="selection">2</Button>
        </div>
    );
}
